"use strict";function set_listeners(){base_search_set=$("#search-set").detach().removeAttr("id").clone(),get_new_search_set().insertBefore($("#action-buttons").closest("div.form-group"))}function add_search_set(){var a=$("#action-buttons").closest("div.form-group"),b=get_new_search_set();b.hide(),b.insertBefore(a),b.slideDown()}function get_new_search_set(){var a=base_search_set.clone();return a.find("select, input, button").each(function(){$(this).attr("name",$(this).attr("name")+"["+num_boxes+"]")}),num_boxes++,a}function remove_search_set(a){$(a).closest(".search-set").slideUp(400,function(){$(this).remove()})}var base_search_set=void 0,num_boxes=0;